using System;
using System.Runtime.InteropServices;
using System.Runtime.CompilerServices;

namespace AutoCSer.Search
{
    /// <summary>
    /// 搜索字符简体化
    /// </summary>
    public unsafe struct Simplified
    {
        /// <summary>
        /// 可直接用于搜索简体文本
        /// </summary>
        internal string FormatText;
        /// <summary>
        /// 搜索简体文本字符长度
        /// </summary>
        internal int Size;
        /// <summary>
        /// 可直接用于搜索简体文本
        /// </summary>
        public SubString Text
        {
            get { return new SubString(0, Size, FormatText); }
        }
        /// <summary>
        /// 设置文本数据
        /// </summary>
        /// <param name="text">文本</param>
        /// <param name="maxSize">最大搜索文本长度（包括间隔空格）</param>
        [MethodImpl(AutoCSer.MethodImpl.AggressiveInlining)]
        public void Set(string text, int maxSize)
        {
            Set(text, maxSize, false);
        }
        /// <summary>
        /// 设置文本数据
        /// </summary>
        /// <param name="text">文本</param>
        /// <param name="maxSize">最大搜索文本长度（包括间隔空格）</param>
        /// <param name="isThreadParameter">线程参数</param>
        internal void Set(string text, int maxSize, bool isThreadParameter)
        {
            Size = 0;
            if (!string.IsNullOrEmpty(text))
            {
                char* simplified = chars.Char;
                int isSpace = 1;
                fixed (char* textFixed = text)
                {
                    char* start = textFixed, end = textFixed + text.Length;
                    do
                    {
                        if (isSpace == 0)
                        {
                            if (simplified[*start] == ' ') isSpace = 1;
                            if (++Size == maxSize) break;
                        }
                        else if (simplified[*start] != ' ')
                        {
                            isSpace = 0;
                            if (++Size == maxSize) break;
                        }
                    }
                    while (++start != end);
                    if (Size != 0)
                    {
                        if (isSpace == 0) ++Size;
                        if (FormatText == null || FormatText.Length < Size)
                        {
                            FormatText = AutoCSer.Extension.StringExtension.FastAllocateString(isThreadParameter ? maxSize + 1 : Size);
                        }
                        isSpace = 1;
                        fixed (char* newTextFixed = FormatText)
                        {
                            char* write = newTextFixed;
                            end = newTextFixed + (Size - 1);
                            start = textFixed;
                            do
                            {
                                *write = simplified[*start];
                                if (isSpace == 0)
                                {
                                    if (*write == ' ') isSpace = 1;
                                    ++write;
                                }
                                else if (*write != ' ')
                                {
                                    ++write;
                                    isSpace = 0;
                                }
                                ++start;
                            }
                            while (write != end);
                            *end = ' ';
                        }
                        return;
                    }
                }
            }
        }
        /// <summary>
        /// 搜索简体文本字符长度
        /// </summary>
        /// <returns>搜索简体文本字符长度</returns>
        [MethodImpl(AutoCSer.MethodImpl.AggressiveInlining)]
        public int GetSize()
        {
            return Size;
        }
        /// <summary>
        /// 格式化字符集
        /// </summary>
        private static Pointer chars;
        /// <summary>
        /// 繁体转简体
        /// </summary>
        /// <param name="text"></param>
        /// <returns></returns>
        public static string Format(string text)
        {
            if (!string.IsNullOrEmpty(text))
            {
                char* simplified = chars.Char;
                fixed (char* textFixed = text)
                {
                    for (char* start = textFixed, end = textFixed + text.Length; start != end; ++start)
                    {
                        if (simplified[*start] != *start)
                        {
                            string newText = new string(textFixed, 0, text.Length);
                            fixed (char* newTextFixed = newText)
                            {
                                char* write = newTextFixed + (int)(start - textFixed);
                                do
                                {
                                    *write++ = simplified[*start++];
                                }
                                while (start != end);
                            }
                            return newText;
                        }
                    }
                }
            }
            return text;
        }
        /// <summary>
        /// 繁体转简体
        /// </summary>
        /// <param name="start">起始位置</param>
        /// <param name="length">字符数量</param>
        public static void Format(char* start, int length)
        {
            if (start != null && length > 0)
            {
                char* simplified = chars.Char, end = start + length;
                do
                {
                    *start = simplified[*start];
                }
                while (++start != end);
            }
        }
        /// <summary>
        /// 格式化搜索字符串
        /// </summary>
        /// <param name="text">文本</param>
        /// <param name="write">写入位置</param>
        /// <param name="length">格式化长度</param>
        internal static void FormatNotEmpty(string text, char* write, int length)
        {
            char* simplified = chars.Char;
            fixed (char* textFixed = text)
            {
                char* start = textFixed, end = textFixed + length;
                do
                {
                    *write++ = simplified[*start++];
                }
                while (start != end);
            }
        }
        /// <summary>
        /// 设置中文字符类型
        /// </summary>
        /// <param name="charTypeData"></param>
        internal static void SetChinese(byte* charTypeData)
        {
            char* simplified = chars.Char;
            for (int code = 0x4E00; code <= 0X9FA5; ++code)
            {
                if (simplified[code] != ' ') charTypeData[code] |= (byte)WordType.Chinese;
            }
        }
